function BindSubmitAjax(n,t,i){var r=$(n);r.submit(function(n){n.preventDefault();var u={};formArray=r.serializeArray();$(formArray).each(function(n,t){u[t.name]=t.value});$.ajax({type:"POST",url:r.attr("action"),data:JSON.stringify(u),contentType:"application/json; charset=utf-8",dataType:"json",success:t,error:i})})}